var template = function (templateHTML, data) {
    for(var x in data) {
        var torep = new RegExp('{{'+x+'}}', 'gi');
        if(torep) {
            templateHTML = templateHTML
                .replace(torep,
                    data[x] == null ? '' : data[x]);
        }
    }

    return templateHTML;
};

