var render_data = function(_data) {
	$("#reports").html('');
	_data.forEach(function(item) {
		var data = JSON.parse(JSON.stringify(item)),
			html;

		data.total_earnings = numeral(data.total_earnings).format('$ 0,0[.]00')
		data.channel = item.channel;
		data.breakdown = [];
		data.breakdown_tpl = [];

		item.earnings_breakdown.forEach(function(_item) {
			var iitem = _item.split(','),
				tpl = {
					video_id: iitem[4],
					report_id: iitem[0],
					video_title: iitem[5].length ? iitem[5] : 'n/a',
					earnings: numeral(iitem[6]).format('$ 0,0[.]00'),
					month: iitem[7]
				};

			data.channel_id = iitem[2];
			data.breakdown.push(tpl);
			data.breakdown_tpl.push(template($('#strike-tpl').html(), tpl));
		});

		data.breakdown_tpl = data.breakdown_tpl.join('');

		html = template($("#strike-parent-tpl").html(), data);

		$("#reports").append(html).promise().done(function() {
			$("table").dataTable().promise().done(function() {
				$(".dataTables_paginate").addClass('pull-right');
				$('.dataTables_filter').parent().addClass('text-right');
				$('.dataTables_info').parent().css('line-height', '74px');
			});
		});
	});
}

